css:
@-moz-document url-prefix("https://educacionadistancia.juntadeandalucia.es/") {
html {
	color: #36ca2f;
	background: rgb(48,48,48) url("data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAQAAAAECAIAAAAmkwkpAAAAGXRFWHRTb2Z0d2FyZQBBZG9iZSBJbWFnZVJlYWR5ccllPAAAAClJREFUeNpiFBQU5OXlZQADJmFhYQYYYPr16xeQ+vz5M4gDEYPIAwQYAJUPBptp0pKhAAAAAElFTkSuQmCC") repeat !important;
}
#logo_junta {
    float: left;
    padding-right: 10px;
    margin-right: 0px;
    background: transparent url("data:image/png;base64,") no-repeat scroll 0px 0px;
    height: 108px;
    width: 472px;
}
#logo_raton {
    width: 320px;
    height: 116px;
    background: transparent url("data:image/png;base64,") no-repeat scroll right top;
    display: block;
    float: right;
}
#page-header {
    border-top: 5px solid #09551B;
    height: 110px;
    margin-top: 40px;
    background: rgb(48,48,48) url("data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAQAAAAECAIAAAAmkwkpAAAAGXRFWHRTb2Z0d2FyZQBBZG9iZSBJbWFnZVJlYWR5ccllPAAAAClJREFUeNpiFBQU5OXlZQADJmFhYQYYYPr16xeQ+vz5M4gDEYPIAwQYAJUPBptp0pKhAAAAAElFTkSuQmCC") repeat !important;
}
.navbar {
    margin-bottom: 0px;
    background: rgb(48,48,48) url("data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAQAAAAECAIAAAAmkwkpAAAAGXRFWHRTb2Z0d2FyZQBBZG9iZSBJbWFnZVJlYWR5ccllPAAAAClJREFUeNpiFBQU5OXlZQADJmFhYQYYYPr16xeQ+vz5M4gDEYPIAwQYAJUPBptp0pKhAAAAAElFTkSuQmCC") repeat !important;
    border: 0px solid #808080;
    color: #00b000;
}
#page #page-content #region-main, #page #page-content div[role="main"], .pagelayout-redirect #page-content #region-main, .pagelayout-redirect #page-content div[role="main"] {
    border: 0px solid #E3E3E3;
    border-radius: 6px;
    background: rgb(48,48,48) url("data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAQAAAAECAIAAAAmkwkpAAAAGXRFWHRTb2Z0d2FyZQBBZG9iZSBJbWFnZVJlYWR5ccllPAAAAClJREFUeNpiFBQU5OXlZQADJmFhYQYYYPr16xeQ+vz5M4gDEYPIAwQYAJUPBptp0pKhAAAAAElFTkSuQmCC") repeat !important;
    padding: 2px 10px;
    margin-bottom: 20px;
}
#page {
    padding-top: 10px;
    background-color: rgba(255, 255, 255, 0.15);
}
#block-region-side-pre {
    padding: 3px;
    background-color: rgba(65, 64, 64, 0.15);
}
#block-region-side-post {
    padding: 3px;
    background-color: rgba(65, 64, 64, 0.15);
}
#block-region-side-pre .block {
    min-height: 20px;
    margin-bottom: 20px;
    border: 1px solid #202020;
    border-bottom-right-radius: 4px;
    border-bottom-left-radius: 4px;
    background-color: rgba(65, 64, 64, 0.15);
}
#block-region-side-post .block {
    min-height: 20px;
    margin-bottom: 20px;
    border: 1px solid #202020;
    border-bottom-left-radius: 4px;
    border-bottom-right-radius: 4px;
    background-color: rgba(65, 64, 64, 0.15);
}
.dropdown-menu {
    position: absolute;
    top: 100%;
    left: 0px;
    z-index: 1000;
    display: none;
    float: left;
    min-width: 160px;
    padding: 5px 0px;
    margin: 2px 0px 0px;
    list-style: outside none none;
    background-color: rgba(64, 64, 64, 0.95);
    border: 1px solid rgba(0, 0, 0, 0.2);
    border-radius: 6px;
    box-shadow: 0px 5px 10px rgba(0, 0, 0, 0.2);
    background-clip: padding-box;
}
.navbar .navbar-inner .messagemenu ul.nav ul.dropdown-menu li > a {
    padding: 0px;
    border-top: 1px dotted #028715;
    background-color: rgba(64, 64, 64, 0.95);
}
.subcontent.loginsub {
    color: #FFF;
    border-radius: 6px;
    background: rgba(13, 144, 48, 0.15) url("data:image/png;base64,") no-repeat scroll left top;
    width: 100%;
    margin-top: 0px;
}
.subcontent.guestsub {
    color: #FFF;
    border-radius: 6px;
    background-color: rgba(161, 255, 186, 0.15);
    width: 100%;
    margin-top: 5px;
}
.signuppanel {
    background-color: rgba(255, 255, 255, 0.15);
    color: #09571C;
    margin: 5px 1px 1px 25px;
    text-align: center;
    border: 1px solid #E3E3E3;
    border-radius: 6px;
}
#page-footer {
    background: rgba(65, 65, 65, 0.15);
		border-top: 15px solid rgba(45, 156, 72, 0.2);
}
#page-footer hr {
    border-top: 1px solid rgba(65, 65, 65, 0);
}
.forumpost, .forumheaderlist {
    background: rgba(0, 131, 15, 0.29) none repeat scroll 0% 0%;
    border-radius: 10px;
    border: 1px solid #171717 !important;
    padding: 10px;
}
body {
  	color: #36ca2f;
	  background: rgb(48,48,48) url("data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAQAAAAECAIAAAAmkwkpAAAAGXRFWHRTb2Z0d2FyZQBBZG9iZSBJbWFnZVJlYWR5ccllPAAAAClJREFUeNpiFBQU5OXlZQADJmFhYQYYYPr16xeQ+vz5M4gDEYPIAwQYAJUPBptp0pKhAAAAAElFTkSuQmCC") repeat !important;
	margin: 10px 10px 10px 10px;
	font-family: helvetica;
	font-size: 13px;
	text-align: justify;  
}
#dock {
	background-color: #818181;
	border-right-color: #4D4D4D;
}
.navbar {
	background-color: #565656;
  	color: #36ca2f;
}
.breadcrumb, .breadcrumb a:link, .breadcrumb a:visited {
	color: #36ca2f;
	font-weight: bold;
}
#dock .dockeditem .dockedtitle {
	border-color: #303030;
	background-color: #565656;
	color: #36ca2f;
}
a {
	text-decoration: none;
	color: #36ca2f;
}
.tabtree .here a.nolink, .tabtree .here ul .here a.nolink, .tabtree .here a.nolink:hover, .tabtree .here ul .here a.nolink:hover {
	color: #36ca2f;
	text-decoration: none;
}
.course-content .current {
	background: #818181;
}
.block .header {
	border-bottom: 1px solid #E8E8E8;
	border-color: #565656;
	background-color: #565656;
}
.header, .navbar {
	background: -webkit-gradient(linear, left top, left bottom, color-stop(0%,#959595), color-stop(46%,#0d0d0d), color-stop(50%,#010101), color-stop(53%,#0a0a0a), color-stop(76%,#4e4e4e), color-stop(87%,#383838), color-stop(100%,#1b1b1b)); /* Chrome,Safari4+ */
	background-color: #565656;
	color: #36ca2f;
}
.block .content {
	border: 2px solid;
	border-color: #565656;
	
	background-color: #1a1a1a;
}
.block a {
	color: #4ED729;
}
.block .minicalendar {
  	background-color: #565656;
	font-size: 0.85em;
	border: 1px solid #DDD;
	margin: 10px 0;
	border-collapse: separate;
	border-spacing: 1px;
}
.block .calendar_filters.filters {
	background-color: #565656;
}
.block {
    background: #1A1A1A;
    padding: 6px;
    border: 1px solid #565656;
    -webkit-border-radius: 6px;
    -moz-border-radius: 6px;
    border-radius: 6px;
}
.dir-ltr .breadcrumb-nav ul.breadcrumb.style1 li:first-of-type {
    padding-left: 34px;
    border-top-left-radius: 24px;
    border-bottom-left-radius: 24px;
}
.breadcrumb-nav ul.breadcrumb.style1 li {
    background-color: #89898999;
    border-color: #262626;
    color: #2b2b2b;
}
.navbar, .navbar-inner {
    color: #2b2b2b;
    font-size: 1.1em;
    background: #3030304d;
}
.uneditable-input, input[type="color"], input[type="date"], input[type="datetime-local"], input[type="datetime"], input[type="email"], input[type="month"], input[type="number"], input[type="password"], input[type="search"], input[type="tel"], input[type="text"], input[type="time"], input[type="url"], input[type="week"], textarea {
    background-color: #ffffff1a;
    border: 1px solid #ccc;
    -webkit-box-shadow: inset 0 1px 1px rgba(0, 0, 0, .075);
    -moz-box-shadow: inset 0 1px 1px rgba(0, 0, 0, .075);
    box-shadow: inset 0 1px 1px rgba(0, 0, 0, .075);
    -webkit-transition: border linear .2s, box-shadow linear .2s;
    -moz-transition: border linear .2s, box-shadow linear .2s;
    -o-transition: border linear .2s, box-shadow linear .2s;
    transition: border linear .2s, box-shadow linear .2s;
}
select, textarea, input[type="text"], input[type="password"], input[type="datetime"], input[type="datetime-local"], input[type="date"], input[type="month"], input[type="time"], input[type="week"], input[type="number"], input[type="email"], input[type="url"], input[type="search"], input[type="tel"], input[type="color"], .uneditable-input, .form-item .form-description, .form-defaultinfo, .form-label .form-shortname, .mform legend, .mform legend a {
    color: #50ce63;
}
.navbar .navbar-inner .dropdown-menu {
    border: 1px solid #087021;
    background-color: #565656;
    -webkit-border-radius: 0;
    -moz-border-radius: 0;
    -ms-border-radius: 0;
    -o-border-radius: 0;
    border-radius: 0;
    -webkit-box-shadow: none;
    -moz-box-shadow: none;
    box-shadow: none;
}
}
